void MMS_displacement(double *u, double t, double X, double Y, double Z)
{
  double u_t = (cos(M_PI*(-1.0/4.0)+t*1.0E3)*(1.0/1.0E3))/(t*1.0E3+1.0)-sqrt(2.0)*(1.0/2.0E3);
  u[0] = (X*X)*Y*Z*u_t*(Y*2.0-1.0)*pow(X-1.0,2.0)*(Y-1.0)*(Z-1.0)*-1.0E1;
  u[1] = X*(Y*Y)*Z*u_t*(X*2.0-1.0)*(X-1.0)*pow(Y-1.0,2.0)*(Z-1.0)*1.0E1;
  u[2] = X*Y*Z*u_t*(X-1.0)*(Y-1.0)*(Z-1.0)*(-1.0/1.0E2);
}

void MMS_velocity(double *v, double t, double X, double Y, double Z)
{
  v[0] = (X*X)*Y*Z*(Y*2.0-1.0)*pow(X-1.0,2.0)*(Y-1.0)*(Z-1.0)*(cos(M_PI*(-1.0/4.0)+t*1.0E3)*1.0/pow(t*1.0E3+1.0,2.0)+sin(M_PI*(-1.0/4.0)+t*1.0E3)/(t*1.0E3+1.0))*1.0E1;
  v[1] = X*(Y*Y)*Z*(X*2.0-1.0)*(X-1.0)*pow(Y-1.0,2.0)*(Z-1.0)*(cos(M_PI*(-1.0/4.0)+t*1.0E3)*1.0/pow(t*1.0E3+1.0,2.0)+sin(M_PI*(-1.0/4.0)+t*1.0E3)/(t*1.0E3+1.0))*-1.0E1;
  v[2] = X*Y*Z*(X-1.0)*(Y-1.0)*(Z-1.0)*(cos(M_PI*(-1.0/4.0)+t*1.0E3)*1.0/pow(t*1.0E3+1.0,2.0)+sin(M_PI*(-1.0/4.0)+t*1.0E3)/(t*1.0E3+1.0))*(1.0/1.0E2);
}

void MMS_initial_velocity(double *v, double X, double Y, double Z)
{
  MMS_velocity(v, 0.0, X, Y, Z);
}

